import { Component, OnInit } from '@angular/core';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { NavController } from '@ionic/angular';
import { AddMedecinforpatient, getMedecinforPatient, getMedecinsByLocalisationAndSpecialite } from 'src/firebaseConfig';
import { medecinUid } from '../recherche-medecin/recherche-medecin.page';
import { FirebaseApp } from 'firebase/app';
import { inscritUid } from '../login/login.page';


interface MedecinData {
  uid:string,
  nom:string,
  prenom:string,
  sexe:string,
  email: string,
  password: string,
  date: string,
  delegation: string,
  etat: string,
  specialite: string,
  telephone: string,
}

@Component({
  selector: 'app-ajout-medecin',
  templateUrl: './ajout-medecin.page.html',
  styleUrls: ['./ajout-medecin.page.scss'],
})
export class AjoutMedecinPage implements OnInit {


  medecins: MedecinData[] = [];
  medecins1: MedecinData[] = [];
  etat: string | null = null;
  specialite: string | null = null;


  specialites: string[] = [
